import React from 'react';
import { Link } from 'react-router-dom';
class Indexx extends React.Component{
    constructor(props){
        super(props);
        this.state=({
            username:'',
            tesst:'',
            type:''
        })
    }
    onsub = () => {
            alert(`${this.state.username} ${this.state.tesst} ${this.state.type}`);
    }
    render(){

        return(
            <div>
                <form onSubmit={this.onsub} method="post">
                    <label>Source</label>
                    <select name="source">
                        <option value="0">-Select-</option>
                        <option value="Gsuite">Gsuite</option>
                        <option value="0365">0365</option>
                    </select>
                    <input type="text" name="s1" />
                    <label>Destination</label>
                    <select name="destination">
                        <option value="0">-Select-</option>
                        <option value="Gsuite">Gsuite</option>
                        <option value="0365">0365</option>
                    </select>
                    <input type="text" name="s2" />
                    <br /><br />
                    <Link to="/menu" className="ml-auto">
                        <button> View</button>                    
                  </Link>
                </form>
             </div>
        );
    }
}

export default Indexx;
